import React from 'react';

const Input = props => {
  return (
    <div>
      <div className='row'>
        <input
          className='col s12 m12 l12'
          type='number'
          id={props.id}
          value={props.req}
          onChange={props.change}
          autoFocus
        />
      </div>
    </div>
  );
};

export default Input;
